Verenigde Staten
Komedie / Romantiek
99 minuten

geregisseerd door Peter Segal
met Adam Sandler, Drew Barrymore en Rob Schneider

Henry Roth werkt bij een groot aquarium-complex in Hawaii. Hij wordt verliefd op Lucy, een meisje dat aan korte termijn-geheugenverlies lijdt.
Om een relatie met haar aan te knopen moet Henry dus elke keer opnieuw zijn best doen zodat Lucy weer verliefd op hem wordt.

